import React from "react";
import "./Stickers.css";
import StudentChoice from "./StudentChoice";
//import PropTypes from "prop-types";

const Stickers = props => {
  const allStickers = props.stickers.map(sticker => {
    return (
      <Sticker
        key={sticker.alt}
        alt={sticker.alt}
        src={sticker.src}
        onClick={props.onClick}
      />
    );
  });

  return (
    <div>
      <div>Hi sticker man!</div>
      <div>
        <h2>Select a Sticker</h2>
        <div className="sticker-grid">
          <button>
            <img
              src="https://i.ibb.co/qJV6Lyw/Screen-Shot-2019-07-21-at-12-40-07-PM.png"
              alt="dog"
              onClick={props.choose}
            />
          </button>
          <button>
            <img
              src="https://i.ibb.co/LxvRffP/Screen-Shot-2019-07-21-at-12-40-54-PM.png"
              alt="cat"
              onClick={props.choose}
            />
          </button>
          <button>
            <img
              src="https://i.ibb.co/kxLyBgy/Screen-Shot-2019-07-21-at-12-41-46-PM.png"
              alt="dinosaur"
              onClick={props.choose}
            />
          </button>
          <button>
            <img
              src="https://i.ibb.co/Wcqd4bH/Screen-Shot-2019-07-21-at-12-42-21-PM.png"
              alt="turtle"
              onClick={props.choose}
            />
          </button>
          <button>
            <img
              src="https://i.ibb.co/y4c1tY5/Screen-Shot-2019-07-21-at-12-43-18-PM.png"
              alt="unicorn"
              onClick={props.choose}
            />
          </button>
          <button>
            <img
              src="https://i.ibb.co/59fCgK3/Screen-Shot-2019-07-21-at-12-44-27-PM.png"
              alt="dragon"
              onClick={props.choose}
            />
          </button>
          <button>
            <img
              src="https://i.ibb.co/kx6BSqf/Screen-Shot-2019-07-21-at-12-47-22-PM.png"
              alt="fire truck"
              onClick={props.choose}
            />
          </button>
          <button>
            <img
              src="https://i.ibb.co/pLDk13j/Screen-Shot-2019-07-21-at-12-49-41-PM.png"
              alt="race car"
              onClick={props.choose}
            />
          </button>
          <button>
            <img
              src="https://i.ibb.co/0MBCgTJ/Screen-Shot-2019-07-21-at-12-51-45-PM.png"
              alt="smiley face"
              onClick={props.choose}
            />
          </button>
        </div>
      </div>
    </div>
  );
};

export default Stickers;
